import React from 'react';
import './Board.css';

const boardMembers = [
    { name: "Anaya Goradia", role: "President", photo: "./acmwMembers/AnayaGoradia.jpg" },
    { name: "Leila Erhili", role: "Vice President", photo: "./acmwMembers/LeilaErhili.jpg" },
    { name: "Maddie Follosco", role: "Director of Public Relations", photo: "./acmwMembers/MaddieFollosco.jpg" },
    { name: "Meagan A. Vu", role: "Director of Events", photo: "./acmwMembers/MeaganVu.jpg" },
    { name: "Pragnya Vijayan", role: "Co-Event Coordinator", photo: "./acmwMembers/PragnyaVijayan.png" },
    { name: "Irene Chang", role: "Co-Event Coordinator", photo: "./acmwMembers/IreneChang.jpg" },
    { name: "Mandy Lin", role: "Director of Media", photo: "./acmwMembers/MandyLin.jpg" },
    { name: "Beatrice C. Hackman", role: "Co-Industry Liaison", photo: "./acmwMembers/BeatriceHackman.jpg" },
];

const Board = () => {
    return (
        <div className="board-container">
            <h1>ACM-W Board Members</h1>
            <div className="board-grid">
                {boardMembers.map((member, index) => (
                    <div className="profile" key={index}>
                        <img src={member.photo} alt={`photo of ${member.role}`} />
                        <h2>{member.name}</h2>
                        <h3>{member.role}</h3>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Board;
